# The default subdirectory from $ORACLE_HOME for a module is wlserver/modules.
# There are two elements of this:  the "wlserver" part and the "modules" part.
# The "wlserver" part is controlled by loc.<modulename>; while this
# property can be set to anything, the only legal values in the project today
# are "wlserver" and "oracle_common".  The "modules" part is controlled by
# modulesdir.<module-name>; while this property can be set to
# anything, the only legal values in the project today are "modules",
# "modules/features" and "internal".

# Please do not place the property here if the value is the default one.
